def copy_graph(graph):
    """
    Make a copy of a graph
    """
    new_graph = {}
    for node in graph:
        new_graph[node] = set(graph[node])
    return new_graph

def delete_node(ugraph, node):
    """
    Delete a node from an undirected graph
    """
    neighbors = ugraph[node]
    ugraph.pop(node)
    for neighbor in neighbors:
        ugraph[neighbor].remove(node)

def targeted_order(ugraph):
    """
    Compute a targeted attack order consisting
    of nodes of maximal degree

    Returns:
    A list of nodes
    """
    # copy the graph
    new_graph = copy_graph(ugraph)

    order = []
    while len(new_graph) > 0:
        max_degree = -1
        for node in new_graph:
            if len(new_graph[node]) > max_degree:
                max_degree = len(new_graph[node])
                max_degree_node = node

        neighbors = new_graph[max_degree_node]
        new_graph.pop(max_degree_node)
        for neighbor in neighbors:
            new_graph[neighbor].remove(max_degree_node)

        order.append(max_degree_node)
    return order

def fast_targeted_order(ugraph):
    '''improvement to targeted order'''
    copy_of_ugraph = copy_graph(ugraph)
    num_nodes = len(ugraph)
    degree_sets = [set()] * num_nodes
    for node, neighbors in copy_of_ugraph.items():
        degree = len(neighbors)
        degree_sets[degree].add(node)
    L = []
    for k in range(num_nodes - 1, -1, -1):
        while len(degree_sets[k]) != 0:
            u = degree_sets[k].pop()
            neighbors = copy_of_ugraph[u]
            for neighbor in neighbors:
                degree = len(copy_of_ugraph[neighbor])
                degree_sets[degree].remove(neighbor)
                degree_sets[degree - 1].add(neighbor) 
            L.append(u)
            delete_node(copy_of_ugraph, u)
    return L   
        
def running_time():
    running_times_normal = []
    running_times_fast = []
    for n in range(10, 1000, 10):
        upa_graph = UPA(n, 5)
        
        start = time.time()
        targeted_order(upa_graph)
        stop = time.time()
        ellapsed_time = stop - start
        running_times_normal.append(ellapsed_time)
        
        start = time.time()
        fast_targeted_order(upa_graph)
        stop = time.time()
        ellapsed_time = stop - start
        running_times_fast.append(ellapsed_time)
        
    return running_times_normal, running_times_fast

