def num_edges(ugraph):
    '''return number of edges
    '''
    num_edges = 0
    for edge_set in ugraph.values():
        num_edges += len(edge_set)
    return num_edges / 2


def random_order(ugraph):
    '''returns a list of nodes in a random order
    '''
    nodes = list(ugraph.keys())
    random.shuffle(nodes)
    return nodes

def attack(ugraph):
    random_nodes = random_order(ugraph)
    #print(random_nodes)
    resilience = compute_resilience(ugraph, random_nodes)
    return resilience

def attack2(ugraph):
    fast_targeted_nodes = fast_targeted_order(ugraph)
    #print(fast_targeted_nodes)
    resilience = compute_resilience(ugraph, fast_targeted_nodes)
    return resilience  
    

